import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { getInputValueByLabel } from '../../components/form/utils/customFormQueries';

export const ProfileDetails = ({ details }) => {
    return (
        <section className='tile'>
            <table className='task-table'>
                <caption className='sr-only'>
                    <h2 className='sr-only'>Profile Details.</h2>
                </caption>
                <thead>
                    <tr className='sr-only'>
                        <th scope='col'>Add task to a new invoice</th>
                        <th scope='col'>Task description</th>
                        <th scope='col'>Quantity/Item</th>
                        <th scope='col'>Rate</th>
                        <th scope='col'>Amount</th>
                        <th scope='col'>Update Task</th>
                        <th scope='col'>Delete Task</th>
                    </tr>
                </thead>
            </table>
        </section>
    );
};

ProfileDetails.propTypes = {};

const mapStateToProps = (state) => ({
    details: state.profile.details,
});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(ProfileDetails);
